def findAnagrams(s: str, p: str) -> list[int]:
    """Находит все анаграмы 'p' в 's'."""
    def is_anagramm(word, anagramm):
        """Проверяет два слова на анаграммность"""
        return sorted(word) == anagramm

    previus_anagram = False
    anagrams_list = []
    anagram = sorted(p)
    len_p = len(p)

    for i in range(0, len(s) - len_p + 1):
        if previus_anagram and s[i-1:i] == s[i+len_p - 1]:
            anagrams_list.append(i)
        elif is_anagramm(s[i:i+len_p], anagram):
            anagrams_list.append(i)
            previus_anagram = True
        else:
            previus_anagram = False

    return anagrams_list


s = 'cbaebabacd'
p = 'abc'
print(findAnagrams(s, p) == [0, 6])

s = 'abab'
p = 'ab'
print(findAnagrams(s, p) == [0, 1, 2])

s = ''
p = ''
print(findAnagrams(s, p))

